package main

import (
	"context"
	"encoding/json"
	"fmt"
	"os"
	"strings"

	"github.com/joho/godotenv"

	"github.com/showntop/llmack/engine"
	"github.com/showntop/llmack/llm"
	openaic "github.com/showntop/llmack/llm/openai-c"
	"github.com/showntop/llmack/log"
)

func init() {
	godotenv.Load()
	llm.WithSingleConfig(map[string]any{
		"base_url": os.Getenv("hunyuan_base_url"),
		"api_key":  os.Getenv("hunyuan_api_key"),
	})
}

func main() {
	extractFaq(content)
	return

	settings := engine.DefaultSettings()
	settings.LLMModel.Provider = openaic.Name
	settings.LLMModel.Name = "hunyuan-large"
	eng := engine.NewChatEngine(settings, engine.WithLogger(&log.WrapLogger{}))
	esm := eng.Execute(context.Background(), engine.Input{
		Query: content,
	})
	for evt := esm.Next(); evt != nil; evt = esm.Next() {
		if evt.Error != nil {
			panic(evt.Error)
		}
		if cv, ok := evt.Data.(*llm.Chunk); ok {
			fmt.Println("main chunk:", cv.Delta.Message.Content())
		} else {
			fmt.Println("main event name:", evt.Name, "data:", evt.Data)
		}
	}
}

type FormattedValue struct {
	DelimiterValue string `json:"delimiterValue"`
	Key            string `json:"key"`
	PrefixValue    string `json:"prefixValue"`
	TextColor      string `json:"textColor"`
	Type           string `json:"type"`
	Value          string `json:"value"`
}

// Item ...
type Item struct {
	FormattedValue FormattedValue `json:"formattedValue"`
	Value          interface{}    `json:"value"`
}

// Element ...
type Element struct {
	Data [][]Item `json:"data"`
}

// JSONResponse ...
type JSONResponse struct {
	GH [][]Element `json:"_gd"`
}

func extractFaq(raw string) ([]string, error) {
	ff, err := os.Create("xxx.md")
	if err != nil {
		return nil, fmt.Errorf("create file error %v", err.Error())
	}
	defer ff.Close()
	// 解析 jsonData => 问题和答案两列
	var jSONResponse JSONResponse
	err = json.Unmarshal([]byte(raw), &jSONResponse)
	if err != nil {
		return nil, fmt.Errorf("json unmarshal error %v", err.Error())
	}
	// fmt.Println("jSONResponse:", jSONResponse)
	var results []string

	from := 0

	for _, rows := range jSONResponse.GH {
		// fmt.Println(rows)
		for _, row := range rows {
			for _, row := range row.Data {

				ssss := "|"
				for _, col := range row {
					ssss += strings.ReplaceAll(col.FormattedValue.Value, "\n", "\\n")
					// fmt.Print(col.FormattedValue.Value)
					// fmt.Print("|")
					ssss += "|"
				}
				// fmt.Print("\n")
				ssss += "\n"
				ff.WriteString(fmt.Sprintf("%s", ssss))
			}
		}
	}
	if len(results) > from {
		results = results[from:]
	}
	return results, nil
}

